import React from "react";
import AddNumber from "./components/project_1";
import BuyShoe from "./components/project_2";

import {BrowserRouter, Route, Routes} from "react-router-dom";

import "./App.css";

function App() {

  return (
    <BrowserRouter>
      <Routes>
      <AddNumber />
       <BuyShoe />
      </Routes>

    </BrowserRouter>
  );
}

export default App;
